import { useNavigate } from 'react-router-dom';
import useFetchUser from './useFetchUser';
import Nav from './Nav';

function MyPosts() {
    const { user } = useFetchUser();
    const navigate = useNavigate();

    return (
        <div>
            <div>
                <Nav user={user} />
            </div>
            <p>ㅎㅇ</p>
        </div>
    );
}

export default myPosts;
